        </label>
        <input type="submit" value="Submit" />
      </form>
      <style jsx global>{`
        body {
          background-color: #203b4f;
        }
        h2 {
          color: #f5f5f5;
          padding: 14px;
          width: 250px;
        }
        `}
      </style>
    </div>
  );
